import { StyleSheet } from 'react-native';

export default StyleSheet.create({
  'cards': {
    'backgroundColor': '#282c34',
    'padding': [{ 'unit': 'px', 'value': 5 }, { 'unit': 'px', 'value': 0 }, { 'unit': 'px', 'value': 0 }, { 'unit': 'px', 'value': 0 }],
    'position': 'absolute',
    'width': [{ 'unit': '%H', 'value': 1 }],
    'zIndex': '1',
    'textAlign': 'center'
  },
  'cards__card': {
    'display': 'inline-block',
    'float': 'none',
    'height': [{ 'unit': 'px', 'value': 180 }],
    'width': [{ 'unit': 'px', 'value': 100 }],
    'fontSize': [{ 'unit': '%V', 'value': 0.9 }],
    'color': 'black',
    'margin': [{ 'unit': 'px', 'value': 5 }, { 'unit': '%H', 'value': 0.01 }, { 'unit': 'px', 'value': 0 }, { 'unit': 'px', 'value': 0 }],
    'lineHeight': [{ 'unit': 'px', 'value': 1.4 }],
    'paddingLeft': [{ 'unit': 'px', 'value': 0 }]
  },
  'cards__card li': {
    'display': 'inline',
    'textAlign': 'center'
  },
  'centerDiv': {
    'width': [{ 'unit': '%H', 'value': 1 }],
    'textAlign': 'center'
  }
});
